<script type="text/javascript">
var CSRF_TOKEN = 'CSRF_TOKEN';
var CSRF_TOKEN_VALUE = $('[name="CSRF_TOKEN"]').val();

function updateCSRFToken() {

    // Show the loader before the request
    // $('#whole_page_loader').show();

    // Make the AJAX request to get the CSRF token
    $.getJSON("<?php echo base_url('Csrftoken'); ?>")
    .done(function(result) {
        // Update the CSRF token value in the form
        $('[name="CSRF_TOKEN"]').val(result.CSRF_TOKEN_VALUE);
        CSRF_TOKEN_VALUE = result.CSRF_TOKEN_VALUE;
    })
    .fail(function() {
        // Optionally, handle the error here
        // alert('Failed to update CSRF token.');
    })
    .always(function() {
        // Hide the loader after the request completes
        // $('#whole_page_loader').hide();
    });
}
</script>
<script>
    $(document).ready(function() {
        $(function() {
            $('.dtp').datepicker({
                format: 'dd-mm-yyyy',
                autoclose: true
            }).datepicker();
        });
        
        $('#verify').on('click', function(e) {
            //    alert('sadsads');
            var usercode = $('#usercode').val();
            var caseNumber = $('#case_number').val();
            var allVals = [],
                noOfDNos = 0;
            $('[name=VerifyList]:checked').each(function() {
                noOfDNos++;
                allVals.push($(this).val());
            });
            //alert(allVals);
            //alert(noOfDNos);
            if (noOfDNos >= 1) {
                $.post("<?= base_url(); ?>/Judicial/QuestionofLaw/update_dnos_to_verify", {
                    diaryNos: allVals,
                    userCode: usercode,
                    CSRF_TOKEN:CSRF_TOKEN_VALUE
                }, function(result) {
                    updateCSRFToken();
                    
                    var obj = $.parseJSON(result);

                    if (obj.update_details == false) {
                        if (!alert("The searched case is not found")) {
                            location.reload();
                        }
                    }
                });
            }
        });

        $(function() {
            $('.datepick').datepicker({
                format: 'dd-mm-yyyy',
                autoclose: true
            }).datepicker("setDate", new Date());;
        });

        $('#reportTable1').DataTable({
            /* dom: 'Bfrtip',
                buttons: [
                    'excelHtml5',
                    'pdfHtml5'
                ]*/
            "bProcessing": true,
            dom: 'Bfrtip',
            buttons: [
                'excelHtml5',
                {
                    extend: 'pdfHtml5',
                    pageSize: 'A3',
                    customize: function(doc) {
                        doc.content.splice(0, 0, {
                            margin: [0, 0, 0, 5],
                            alignment: 'center',
                            //image: 'data:image/png;base64,'
                            //image: 'data:image/png;base64,'
                            image: 'data:image/png;base64,'
                        });
                        doc.watermark = {
                            text: 'SUPREME COURT OF INDIA',
                            color: 'blue',
                            opacity: 0.05
                        }
                    }
                }

            ]

        });
    });
</script>


